import React from 'react';
import PropTypes from 'prop-types';

const WeatherExtraInfo = ({humidity, wind}) => (
  <div>
    <span>{`${humidity}% - `}</span>
    <span>{wind}</span>
  </div>
);

export default WeatherExtraInfo;
